Dr Animo has escaped from prison using an army of giant ants! Draw lines, walls and ramps to guide Ben through Plumber HQ, the Giant Ant Hill and Dr AnimoÃ¢â‚¬â„¢s secret base and get ready for a final showdown with the Ant King.

Draw platforms to run across gaps, create walls to avoid hazards and line up ramps to perform devastating attacks and defeat enemies on your way to the next level.

Collect power-ups to transform Ben into some of your favourite Omniverse aliens, each with their own special abilities - Shocksquatch, Kickin Hawk, Ball Weevil and Crashhopper.

Features 3 Chapters based on locations seen in the show and over 40 individual rooms giving hours of gameplay.

This game can be finished without any In-App Purchases. Some levels have multiple rooms and if you're struggling on a room you can get help from Rook. The app comes with a pack of 3 Rooks which allows you to skip 3 rooms. More Rook packs are available to buy.

